('-390','The current situation looks like this: we\'re holding what we can while those with more experience and better equipment are moving against Prince Kael\'thas.','0','0','0','25162'),
('-391','I know, we thought he was dead too, but that\'s not the case. He\'s trying to use the Sunwell to bring the master of the Burning Legion, Kil\'jaeden, into this world.','0','0','0','25162'),
('-392','Let me assure you people that if he\'s successful, this world will suffer far worse than Outland ever did! So let\'s make sure that doesn\'t come to pass.','0','0','0','25162'),
('-393','Warriors will be deployed to hold key positions, while you marksmen will be assigned to keep the enemy fliers at bay.','0','0','0','25162'),
('-394','I\'m awaiting orders on your specific assignments. In the meantime, stay here and be ready to move at a moment\'s notice!','0','0','0','25162'),
('-395','Hello to you new recruits. I\'m Drill Sergeant Bahduum. For the next few days, you\'re going to receive orientation.','0','0','0','25162'),
('-396','The Isle of Quel\'Danas has been overrun by the forces of Prince Kael\'thas Sunstrider. Intel had him pegged as deceased. Intel was wrong.','0','0','0','25162'),
('-397','Up on the plateau, he and his demon friends are trying to reignite the Sunwell and open a rift to bring their head-honcho, Kil\'Jaeden back into the world.','0','0','0','25162'),
('-398','Our job is to clear out as much of the fodder as we can, while supporting the specialists that the powers-that-be are having brought in.','0','0','0','25162'),
('-399','Needless to say, a lot of us won\'t be going home. But if you remember your training and keep your wits about you, you\'ll greatly increase your chances.','0','0','0','25162'),
