('-250','Learning to read is a thirsty business. A toast, eh?','0','0','0','21193'),
('-251','faints','0','2','0','18705'),
('-252','C\'mere, $r. Ya don\'t want to be riskin\' yerself in a dungeon, do ya? Filthy work, and for what? Some worthless trinket? Nah, what ya need be one of my amulets. Guarenteed to work! ','0','0','0','19227'),
('-253','Dangerous out there, innit? Know what ya need? Protection. I can help ya defy death itself! Ya wear this madstone \'round yer neck, see, and then ya be able to come back if ya find yerself in the spirit world! Just a quick jaunt to yer corpse and up ya com','0','0','0','19227'),
('-254','Amazing Amulets! Incredible curios! The newfangled jewlcrafters be havin\' nothin\' on the tried and true mystical methods of ol\' Griftah! Improve yerself through these magical talismans for a bargain price!','0','0','0','19227'),
('-255','I could have sworn I had more apples. Grok!','0','0','0','19223'),
('-256','If no one help. Grok smash!','0','0','0','22940'),
('-257','Look over here, $c! I got somethin\' for ya. Just what ya need. It\'s soap, right... and it\'s on a rope! No offense, man, but yer a little ripe, you know what I\'m sayin\'? ','0','0','0','19227'),
('-258','Hey! Hey, $r! I be havin\' just the thing for ya. Ya ever see a Tikbalang? Frightenin\' creatures. Prone to stealin\' ya away. What ya need is my tikbaland wards. Guaranteed to ward away all tikbalangs!','0','0','0','19227'),
('-259','Grok need help! Why no one help?','0','0','0','22940'),
('-260','Mog\'dorg the Wizened tell Grok go to city, get help for Bloodmaul. Grok go.','0','0','0','22940'),
('-261','Bladespire clan not fight fair. Have Gronn to help dem. You go to Blade\'s Edge Mountains. Talk to Mog\'dorg the Wizened. Kill Gromm','0','0','0','22940'),
('-262','Ya look tired, $c. I be havin\' somethin\' for ya. These amulets, they can help ya leap obstacles and swim through the rivers like ya be born to it. They energize the food ya be eatin\'. Makin\' yer wounds close before yer eyes!','0','0','0','19227'),
('-263','What is that poor orc yelling about? Someone should see what is going on.','0','0','0','19223'),
('-264','I feel that war is fast approaching. The fruit vendor has enlisted to help an ogre. I shall have to enlist help as well.','0','0','0','19196'),
('-265','Ya look lovesick. Special someone be gettin\' ya down, eh? No worries, no worries. Ya get this medallion from me, ya wear it when ya see \'em and they be all over ya, sweetheart!','0','0','0','19227'),
('-266','Me hungry. Fruit look tasty.','0','0','0','22940'),
('-267','FRUIT VENDOR!!! Your cart is still in our way! We will give you one more hour to move it from our area. Do not test our patience anymore!','0','1','0','19196'),
('-268','Grok get angry if puny ones not go to Blade\'s Edge and talk to Mog\'dorg!','0','0','0','22940'),
('-269','Nothing like a tankard full to wash down one of my magnificent muffins.','0','0','0','19664'),
('-270','Yea, that hit the spot. Muffins for sale! Get your fresh muffins right here!','0','0','0','19664'),
('-271','Yea, yea, I\'m the muffin man. You know why? Because I sell muffins, that\'s why!','0','0','0','19664'),
('-272','I\'ve got muffins right over here. Come on over!','0','0','0','19664'),
('-273','May it be so.','0','0','0','19138'),
('-274','Anchorite Nindumen, I have a request to make of you.','0','0','0','19346'),
('-275','We\'ve just sent another inexperienced squad into Nagrand. Might you offer a prayer for them?','0','0','0','19346'),
('-276','May it be so.','0','0','0','19346'),
('-277','Of course, my friend. How can I be of service to you?','0','0','0','19378'),
('-278','A noble request. It would be an honor, Erothem.','0','0','0','19378'),
('-279','My friends, please join me in humble supplication the the Light.','0','0','0','19378'),
('-280','Light that we embrace, we beseech thee...','0','0','0','19378'),
('-281','Into our struggle against the darkness we have sent our children.','0','0','0','19378'),
